# SET OPERATIONS

'''
Given two sets A and B, calculate the following:

A ∪ B
A ∩ B
A - B
B - A
A complement
B complement
'''

# union function
def uni(set1, set2):

    uniSet = set(set1).union(set2)
    
    return uniSet


# intersection function
def inter(set1, set2):

    intSet = set(set1).intersection(set(set2))

    return intSet


# subtract function
def subtract(set1, set2):

    subSet = set(set1)

    for elem in set2:
        if elem in subSet:
            subSet.remove(elem)
        else:
            pass
    
    return subSet


# complement function
def comp(set1, n):

    universalSet = set([x for x in range(1,n+1)])

    for elem in set1:
        universalSet.remove(elem)
    
    return universalSet


